import React, { Component } from "react"

export default class PaintingCard extends Component {
  constructor(props){
    this.state = {
      votes: props.votes
    }
  }


  render(){
    return <li>
      <h3>{this.props.title}</h3>
      <p>By {this.props.artistName}</p>
      <img src={this.props.image}></img>
      <p>Votes: {this.props.votes}</p>
    </li>
  }
}
